  return (
    <React.Fragment>
      <div className="request-community-container">
        <form className="request-community-form">
          <p>Community</p>
        </form>
      </div>

      <style jsx>{`
        .request-community-form {
          height: 550px;
          width: 50%;
          border: 1px solid red;
        }
      `}</style>
    </React.Fragment>
  );
};

export default RequestCommunityPage;
